import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";
import logo from "../images/Icon.png";
import Login from "./Login";
import "../index.css";

import NavDropdown from "react-bootstrap/NavDropdown";
import Register from "./Register";
import { useNavigate } from "react-router-dom";

function Navbars(e) {
  const dataLog = JSON.parse(localStorage.getItem("Login"));
  console.log(dataLog);

  const navigate = useNavigate();

  const remove = () => {
    localStorage.removeItem("Login");
    navigate(0);
  };

  return (
    <>
      <Navbar bg="none" style={{ height: "74px" }}>
        <Container>
          <Navbar.Brand href="#home">
            <img src={logo} className="d-inline-block align-top" alt="logo" />
          </Navbar.Brand>
          <Navbar.Toggle />
          {dataLog !== null ? (
            <div>
              <div className="d-flex">
                <img src={require("../images/userNav.png")} alt="" />
                <NavDropdown
                  style={{
                    color: "white",
                    fontSize: "20px",
                    margin: "10px",
                  }}
                  id="navbarScrollingDropdown"
                  align="end"
                >
                  <NavDropdown.Item href="#action3">Action</NavDropdown.Item>
                  <NavDropdown.Item href="#action4">
                    Another action
                  </NavDropdown.Item>
                  <NavDropdown.Divider />
                  <NavDropdown.Item onClick={remove} href="#action5">
                    Something else here
                  </NavDropdown.Item>
                </NavDropdown>
              </div>
              {/* <button onClick={remove}>Button</button> */}
            </div>
          ) : (
            <Navbar.Collapse className="justify-content-end">
              <Login />
              <Register />
            </Navbar.Collapse>
          )}
        </Container>
      </Navbar>
    </>
  );
}

export default Navbars;
